function Header() {
    return (
        <div className="header">
            <HamburgerMenu/>
            <Title title="The FPL Bible"/>
        </div>
    )
};

function HamburgerMenu() {
    return (
        <div className="hamburger">
            <span className="bar"></span>
            <span className="bar"></span>
            <span className="bar"></span>
        </div>
    )
};

function Title(props) {
    return (
        <div className="title">
            <h1>{props.title}</h1>
        </div>
    )
};


export default Header;
